    const [token, setToken] = useState(null);

    return (
        <div className="app">
            {!token ? (
                <Login setToken={setToken} />
            ) : (
                <>
                    {/* Uncomment and use Fact component when it's ready */}
                    {/* <Fact token={token} /> */}
                    {/* <Logout /> */}
                </>
            )}
        </div>
    );
}

export default App;
